Movie Info: Ladies and Gentleman is a Malayalam comedy film written and directed by Siddique and starring Mohanlal, Krish. J. Sathaar and Mamta Mohandas in the lead roles. The film is produced by Antony Perumbavoor under the banner Aashirvad Cinemas. The film's soundtrack was composed by Ratheesh Vegha, with lyrics penned by Rafeeq Ahammed and Salavoodheen Kecheri. Cinematography is handled by Satheesh Kurup, and the editing is by K.R.Gowri Shanker. The film opened to mixed response, but the film managed to become a hit at the box office.

